package day09Java;
import java.util.Scanner;

public class Slide46Nestedloops {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=1;i<=5;i++) {
			System.out.println("my inner loop");
		}
		for(int j =1; j<=2;j++) {
			System.out.println("my outer loop");
		}

	}

}
